import React, { useState } from 'react';
import { Redirect } from "react-router-dom";
import "./styles/register.css";
import { Error } from './error';
import { Registration } from './user';



export default function Signup() {
    const [innerEmail, setInnerEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState(false);
    const [errorCode, setErrorCode] = useState();
    const [verified, setVerified] = useState(false);




    if (verified === false) {
        return (
            <div>
                <div className="jumbo">
                    <div className="transbox">
                        <div className="transMessage">
                            <div className="title">
                                Happiness
                            </div>
                        </div>
                    </div>
                    <div className="registration-form">
                        <Error error={error} type="registration" code={errorCode} />
                        <div>
                            <div>
                                <p className="login-label">Email</p>
                                <input
                                    aria-labelledby="email-field"
                                    name="email"
                                    id="email"
                                    type="email"
                                    value={innerEmail}
                                    onChange={(e) => setInnerEmail(e.target.value)}
                                />
                            </div>

                            <div>
                                <p className="login-label" >Create Password</p>
                                <input
                                    aria-labelledby="password-field"
                                    name="password"
                                    id="password"
                                    type="password"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                />
                            </div>
                            <button
                                id="submit-button"
                                type="button"
                                onClick={() => { Registration() }}>
                                Signup
                            </button>
                        </div>
                    </div>
                </div>
            </div>
        );
    } else if (verified === true) {
        return (
            <div>
                <Redirect to="/login" />
            </div>
        )
    }
}
